import { prestataires } from "./data";
function getAllPrestataires() {
    return { error: 0, data: prestataires };
}

function insertBillet(vue){
    //Insert les données correctement
    console.log(vue.firstName);
    return {error: 0, status: 200}
}

export default {
    getAllPrestataires,
    insertBillet,
};
